def identifyDNA(text):
	gccontent = text.split(">")
	percentage_string = []
	name_string = []
	for DNA in gccontent:
		totalCG = DNA.count('C') + DNA.count('G')
		percentage = 100 * (totalCG / len(DNA[13:]))
		name_string.append(DNA[:13])
		percentage_string.append(percentage)
		print (name_string, percentage_string)
	print (name_string) 
	print (max(percentage_string))	
identifyDNA("Rosalind_>Rosalind_>Rosalind_>Rosalind_>Rosalind_>Rosalind_>Rosalind_>Rosalind_>Rosalind_")	
